pragma solidity ^0.4.17;

import "./ConvertLib.sol";

contract Order{
    uint INITAL_SUPPLY = 1000;
    struct order {
        address sender;
        address recipient;
        string start;
        string destination;
        uint amount;
    }
    order[] public order_list;
    mapping (address => uint) public balances;

    constructor() public {
        balances[msg.sender] = INITAL_SUPPLY;
    }

    function sendCoin(address recipient, string start, string destination, uint amount) public returns(bool){
        if (balances[msg.sender] < amount) return false;
        balances[msg.sender] -= amount;
        balances[recipient] += amount;
        order memory o = order(msg.sender, recipient, start, destination, amount); 
        order_list.push(o);
        return true;
    }

    function getBalance(address addr) public view returns(uint) {
        return balances[addr];
    }

    function getLastOrder() public view returns(address, address, string, string, uint) {
        if (order_list.length > 0)
            return (order_list[order_list.length - 1].sender, order_list[order_list.length - 1].recipient, order_list[order_list.length - 1].start, order_list[order_list.length - 1].destination, order_list[order_list.length - 1].amount);
        return (0x0, 0x0, "", "", 0);
    }

}
